def actg_numbers(sub_gene):
    numbers = [0, 0, 0, 0]

    for letter in sub_gene:
        if letter == 'A':
            numbers[0] += 1
        elif letter == 'C':
            numbers[1] += 1
        elif letter == 'T':
            numbers[2] += 1
        elif letter == 'G':
            numbers[3] += 1

    return numbers


def actg_position(single_gene):
    if single_gene == 'A':
        return 0
    elif single_gene == 'C':
        return 1
    elif single_gene == 'T':
        return 2
    elif single_gene == 'G':
        return 3


def actg_compare(actg_num1, actg_num2):
    delta = 0
    points1 = 0
    for num1, num2 in zip(actg_num1, actg_num2):
        if num1 >= num2:
            points1 += 1
        else:
            delta += (num2 - num1)
    if points1 == 4:
        return [True, delta]
    else:
        return [False, delta]


def steadyGene(gene):
    steady_number = int(len(gene) / 4)
    ACTG = actg_numbers(gene)

    min_gene = 0
    min_letters = []
    for letter_num in ACTG:
        if letter_num > steady_number:
            letter_extra = letter_num - steady_number
            min_gene += letter_extra
            min_letters += [letter_extra]
        else:
            min_letters += [0]

    if min_gene == 0:
        return 0
    if min_gene == 1:
        return 1

    start = 0
    end = min_gene
    old_end = end
    possible_lens = []

    state = 1  # INCREASE
    incicial = gene[start:end]
    ACTG_incicial = actg_numbers(incicial)
    ACTG_total = ACTG_incicial[:]
    indexes = [0, 1, 2, 3]
    while True:
        if end >= len(gene):
            break

        delta = 1

        if state == 1:
            ACTG_incicial = ACTG_total[:]
            old_end = end
            end += delta

            extra = gene[old_end:end]
            ACTG_extra = actg_numbers(extra)

            ACTG_total = [0, 0, 0, 0]
            for ind, num1, num2 in zip(indexes, ACTG_incicial, ACTG_extra):
                ACTG_total[ind] = num1 + num2

            result, delta = actg_compare(ACTG_total, min_letters)
            if result:
                state = 0  # DECREASE

        else:
            ACTG_incicial = ACTG_total[:]
            start += 1

            minus = gene[start-1]

            ACTG_total = ACTG_incicial[:]
            ACTG_total[actg_position(minus)] -= 1

            if not actg_compare(ACTG_total, min_letters)[0]:
                state = 1
                possible_lens += [end-start + 1]

    return min(possible_lens)


small_gene = 'TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC'
bear_gene = ''
print(steadyGene(bear_gene))
